$(function(){var e={init:function(){e.intitCropper()},intitCropper:function(){var e=new Cropper({element:document.getElementById("mypic-target"),aspectRatio:.6875,previews:[document.getElementById("mypic-large")],onCroppedRectChange:function(e){console.log(e)}}),t=document.getElementById("mypic");t.onchange=function(){if("undefined"!=typeof FileReader){var n=new FileReader;n.onload=function(t){e.setImage(t.target.result)},t.files&&t.files[0]&&n.readAsDataURL(t.files[0])}else{t.select(),t.blur();var i=document.selection.createRange().text;e.setImage(i)}}}};e.init()});